import React, { FC } from "react";
import { Global, css } from "@emotion/core";

const globalStyles = (
  <Global
    styles={css`
      html {
        background: yellow;
      }
    `}
  ></Global>
);

const Home: FC = () => (
  <div>
    {globalStyles}
    <h1>Hello world!</h1>
  </div>
);

export default Home;
